from finished.common import GRAVITY_c
from finished.gravity import gravity_gensk, gravity_genpk, GravityPK, GravitySign, GravitySK, gravity_sign
from finished.hash import Hash, hash_to_N
from shaky.randombytes import get_random_hash
from utils.bytes_utils import int_list_to_bytes, bytes_to_int_list


def crypto_sign_keypair(seed=None, salt=None) -> (bytes, bytes):
    if not seed:
        seed = get_random_hash()
    if not salt:
        salt = get_random_hash()
    g_sk = GravitySK(seed, None, salt)
    gravity_gensk(g_sk)
    g_pk = GravityPK()
    gravity_genpk(g_sk, g_pk)
    return int_list_to_bytes(g_pk.k.h), g_sk.save()


def crypto_sign(m: bytes, sk: bytes) -> bytes:
    msg = Hash(bytes_to_int_list(hash_to_N(m)))
    g_sk = GravitySK.load(sk)
    sign = GravitySign()
    gravity_sign(g_sk, sign, msg)
    return m + sign.save()


def flow_test():
    seed = Hash([i for i in range(32)])
    salt = Hash([32 - i for i in range(32)])
    pk, sk = crypto_sign_keypair(seed, salt)

    if pk.hex() != "a73e2eb8e10194f424bdafd86ad6c89cf90b9849fe19aeca38c9668512eac6a2":
        raise Exception("Test failed")
    if sk.hex() != "":
        raise Exception("Test failed")

    sign = crypto_sign(int_list_to_bytes([i * 2 for i in range(64)]), sk)
    print(sign.hex())


if __name__ == "__main__":
    if GRAVITY_c != 1:
        raise Exception("To run tests set GRAVITY_c to 1")
    flow_test()

    print("OK")

